const style = {
  map: {
    position: 'absolute',
    top: 0,
    bottom: 0,
    width: '100%'
  }
};

class App extends Component {

  constructor(props) {
    super(props);
    this.toggleComponent = this.toggleComponent.bind(this)
    this.state = {
      header: {
        visible: false
      },
      activityFilter: {
        visible: false,
        selected: [],
        data: []
      },
      districtFilter: {
        visible: false,
        selected: [],
        data: []
      },
      help: {
        visible: false
      },
      dashboard: {
        visible: false
      },
      sidebar: {
        visible: false
      },
      data: {
        activities: emptyCollection,
        districts: emptyCollection
      },
      user: null,
    }
  }

  toggleComponent(component) {
    this.setState({ [component]: {...this.state[component], visible: !this.state[component].visible } })
  }

  componentDidMount() {
    firebase.auth().onAuthStateChanged(user => {
      if (user) {
        this.setState({user: user})
      } else {
        this.setState({user: null})
      }
    });

    this.setState({
      activityFilter: {
        ...this.state.activityFilter,
        data: [...new Set(data.features.map(activity => activity.properties.activity))]},
       districtFilter: {
         ...this.state.districtFilter,
         data: districtData.features.map(district => district.properties.name)
       },
       data: {
         activities: data,
         districts: districtData
       }
      })

    this.map = new mapboxgl.Map({
      container: this.mapContainer,
      style: 'mapbox://styles/mapbox/light-v9',
      center: [-4.4214, 36.7213],
      zoom: 12
    });

    this.map.addControl(new mapboxgl.NavigationControl(), 'bottom-right');

    this.draw = new MapboxDraw({
      controls: {
        combine_features: false,
        uncombine_features: false,
        trash: false,
        polygon: false
      }
    })

    this.map.addControl(this.draw, 'bottom-right');

    this.map.on('load', () => {

      let layers = this.map.getStyle().layers;
      let labelLayerId;
      for (let i = 0; i < layers.length; i++) {
        if (layers[i].type === 'symbol' && layers[i].layout['text-field']) {
          labelLayerId = layers[i].id;
          break;
        }
      }

      this.map.addLayer({
        'id': '3d-buildings',
        'source': 'composite',
        'source-layer': 'building',
        'filter': ['==', 'extrude', 'true'],
        'type': 'fill-extrusion',
        'minzoom': 15,
        'paint': {
          'fill-extrusion-color': '#aaa',
          'fill-extrusion-height': [
            'interpolate', ['linear'], ['zoom'],
            15, 0,
            15.05, ['get', 'height']
          ],
          'fill-extrusion-base': [
            'interpolate', ['linear'], ['zoom'],
            15, 0,
            15.05, ['get', 'min_height']
          ],
          'fill-extrusion-opacity': .6
        }
      }, labelLayerId);

      this.map.addSource('activities', {
        type: 'geojson',
        data: this.state.data.activities
      });

      this.map.addSource('districts', {
        type: 'geojson',
        data: this.state.data.districts
      });

      this.map.addLayer({
        id: 'districts',
        source: 'districts',
        type: 'fill',
        'paint': {
            'fill-color': '#00aec7',
            'fill-opacity': 0.2
        },
        filter: ['match', ['get', 'name'], ['none', ...this.state.districtFilter.selected], true, false]
    });

      this.map.addLayer({
        id: 'lineActivities',
        source: 'activities',
        type: 'line',
        'layout': {
          'line-join': 'round',
          'line-cap': 'round'
        },
        'paint': {
          'line-color': '#AAA',
          'line-width': 2
        }
      });

      this.map.addLayer({
        id: 'pointActivities',
        source: 'activities',
        type: 'circle',
        paint: {
          'circle-radius': {
            'base': 1.75,
            'stops': [[12, 2], [22, 180]]
          },

          'circle-color': [
            'match',
            ['get', 'activity'],
            'Ciclismo', '#fbb03b',
            'Parkour', '#223b53',
            'Running', '#e55e5e',
            'Yoga', '#3bb2d0',
            '#Ff8326'
          ]
        }
      });

      ['pointActivities', 'lineActivities'].forEach(activityType => {
        this.map.on('mouseenter', activityType, () => {
          this.map.getCanvas().style.cursor = 'pointer';
        });

        this.map.on('mouseleave', activityType, () => {
          this.map.getCanvas().style.cursor = '';
        });

        this.map.on('click', activityType, e => {
          let featureProperties = e.features[0].properties;
          console.log(featureProperties)
        });
      })

      this.map.on('draw.create', e => {
        let newPoint = e.features[0];

        this.toggleComponent('sidebar')
      });
    });
  }

  componentDidUpdate () {
    // this.map.setFilter('districts', ['match', ['get', 'name'], ['none', ...this.state.districtFilter.selected], true, false]);
  }

  componentWillUnmount() {
    this.map.remove();
  }

  render() {

    return (
      <div style={style.map} ref={el => this.mapContainer = el} >
        <Header {...this.state.header} user={{...this.state.user}} toggleComponent={this.toggleComponent} />
        <Dashboard {...this.state.dashboard} user={{...this.state.user}} toggleComponent={this.toggleComponent} />
        <Help {...this.state.help} toggleComponent={this.toggleComponent} />
        <Sidebar {...this.state.sidebar} toggleComponent={this.toggleComponent} />
        <DistrictFilter {...this.state.districtFilter} toggleComponent={this.toggleComponent}/>
        <ActivityFilter {...this.state.activityFilter} toggleComponent={this.toggleComponent}/>
        <NotificationContainer />
      </div>
    );
  }
}

export default App;